import { NextPage } from 'next';
import Comment from './Comment';

type Props = {
  commentIDs: number[];
};

const CommentSection: NextPage<Props> = props => {
  const { commentIDs } = props;
  return (
    <div>
      <ul>
        {commentIDs.map(el => (
          <Comment commentId={el} />
        ))}
      </ul>
    </div>
  );
};

export default CommentSection;
